import React, {Component} from'react'

class Search extends Component{


    render(){

        fetch('http://localhost:5000/get')
                    .then(response => response.json())
                    .then((data) => {
                        console.log(data.dbArray)

                    })
                    .catch(error => console.error(error));    

        return(
            <div>
                <p>this is search</p>
                <input />
            </div>

        )
    }
}

export default Search;
